import requests

student_ID = 2300320225


def post_http(jsonBody, uriAdress):
    response = requests.post(uriAdress, json=jsonBody)
    print(response.text)


def sign_out(student_ID):
    body = {'userId': student_ID}
    post_http(body, 'https://at.kexie.space/api/user/signOut')


def sign_in(student_iD):
    body = {'userId': student_iD}
    response = requests.post('https://at.kexie.space/api/user/signIn', json=body)
    print(response.text)


# 获取目标状态
def find_target_is_online(id):
    response = requests.get(f'https://at.kexie.space/api/record/online/{id}')
    temp = response.json()
    online = temp['data']['status']
    return online


# 获取在线的用户
def get_online_users():
    response = requests.get(f'https://at.kexie.space/api/record/online')
    toJson = response.json()
    data = toJson['data']
    online_id = []
    for item in data:
        online_id.append(item['userId'])
    return online_id


# 举报所选目标
def tip_off(targetId):
    body = {'targetUserId': targetId, 'operatorUserId': 00000}
    post_http(body, 'https://at.kexie.space/api/user/complaint')


# 一键举报
def tip_off_all():
    targets = get_online_users()
    for single in targets:
        tip_off(single)


